import React from "react";

class Form extends React.Component {
    render() {
        return (
            <div>
                <form onSubmit={this.props.weatherMethod}>
                    <input type="text" name="city" placeholder="Фильтр по тексту "/>
                    <button>Список заметок</button>
                </form>
            </div>
        );
    }
}

export default Form;
